// SPDX-License-Identifier: Apache-2.0
pragma solidity 0.8.24;

import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract BRNBalanceGetter is AccessControlUpgradeable {
    bytes32 public version;

    /// *** Modifiers ***

    modifier onlyOwner() {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "BRNBalanceGetter#0");
        _;
    }

    /// *** Contract logic ***

    /// @dev Constructor function for this upgradeable contract
    /// @param  _owner  The owner of the contract, as well as the proxy
    function initialize(address _owner) public initializer {
        __AccessControl_init();
        _grantRole(DEFAULT_ADMIN_ROLE, _owner);
    }

    function disableInitializers() public onlyOwner {
        _disableInitializers();
    }

    function setVersion(bytes32 _version) external onlyOwner {
        version = _version;
    }

    function totalSupply() public view returns (uint256) {
        return 100 * 10 ** 6 * 10 ** 18;
    }

    function balanceOf(address account) public view returns (uint256) {
        return address(account).balance;
    }
}

